-- ----------------------------
--  Table structure for `fa_crontab`
-- ----------------------------
DROP TABLE IF EXISTS `fa_crontab`;
CREATE TABLE `fa_crontab` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `type` varchar(10) NOT NULL DEFAULT '' COMMENT '事件类型',
  `title` varchar(100) NOT NULL DEFAULT '' COMMENT '事件标题',
  `content` text NOT NULL COMMENT '事件内容',
  `schedule` varchar(100) NOT NULL DEFAULT '' COMMENT 'Crontab格式',
  `sleep` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '延迟秒数执行',
  `maximums` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '最大执行次数 0为不限',
  `executes` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '已经执行的次数',
  `createtime` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `updatetime` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `begintime` int(10) NOT NULL DEFAULT '0' COMMENT '开始时间',
  `endtime` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '结束时间',
  `executetime` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '最后执行时间',
  `weigh` int(10) NOT NULL DEFAULT '0' COMMENT '权重',
  `status` enum('completed','expired','hidden','normal') NOT NULL DEFAULT 'normal' COMMENT '状态',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='定时任务表';

-- ----------------------------
--  Table structure for `fa_data`
-- ----------------------------
DROP TABLE IF EXISTS `fa_data`;
CREATE TABLE `fa_data` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `tid` varchar(20) DEFAULT NULL,
  `type` varchar(10) DEFAULT NULL,
  `avatar_url` text,
  `description` varchar(50) DEFAULT NULL,
  `name` varchar(50) DEFAULT NULL,
  `fans_count` int(11) DEFAULT NULL COMMENT '累计粉丝数',
  `play_effective_count` int(11) DEFAULT NULL COMMENT '播放数',
  `impression_count` int(11) DEFAULT NULL COMMENT '展示数(推荐数)',
  `view_count` int(11) DEFAULT NULL COMMENT '阅读数',
  `repin_count` int(11) DEFAULT NULL COMMENT '收藏数',
  `digg_count` int(11) DEFAULT NULL COMMENT '点赞数',
  `comment_count` int(11) DEFAULT NULL COMMENT '评论数',
  `share_count` int(11) DEFAULT NULL COMMENT '分享数',
  `publish_num` int(11) DEFAULT NULL COMMENT '发文数',
  `status` varchar(30) DEFAULT 'normal' COMMENT '状态',
  `createtime` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `updatetime` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '更新时间',
  `time` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=45 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='数据';

-- ----------------------------
--  Records of `fa_data`
